 is epic.

Outdoor beer garden is fabulous! Will return with a crowd once restrictions on numbers are lifted and really look forward to a big group dinner there!","time":1620296535},{"author_name":"Alison Foreman","author_url":"https://www.google.com/maps/contrib/102803104378108318898/reviews","language":"en","profile_photo_url":"https://lh3.googleusercontent.com/a/AATXAJzXpJ1e7SqprPTCHIZZUvy2GjoVD2A-1GX_7PxK=s128-c0x00000000-cc-rp-mo","rating":5,"relative_time_description":"in the last week","text":"Lovely outdoor space with a flexible shades/heaters. Delicious vegan burger and very crisp salad.
Friendly service, reasonable prices.","time":1620424685},{"author_name":"Abby Richardson","author_url":"https://www.google.com/maps/contrib/102026651581055080926/reviews","language":"en","profile_photo_url":"https://lh3.googleusercontent.com/a/AATXAJykvpvBUpER0iRJRwNyd52c-6tgz209D_zhS_5w=s128-c0x00000000-cc-rp-mo","rating":5,"relative_time_description":"2 weeks ago","text":"We turned up wishful thinking to get a walk in table/ cancellation booking Saturday 24th April 2021, and a wonderful gentleman called Adam went out of his way to accommodate us in a very lush spot in the outdoor beer garden section. We were so lucky to win ourselves a cancellation booking so last minute. We very much overstayed our welcome as well until the next booking came along. The food was delicious and the drinks came incredibly fast which was fantastic and Adam came and checked in on us a few times to make sure we were having the best time. It truly made our day! I will definitely be back there again in the Summer!!!","time":1619424604},{"author_name":"Joseph Honeywood","author_url":"https://www.google.com/maps/contrib/100324496797931149246/reviews","language":"en","profile_photo_url":"https://lh3.googleusercontent.com/a-/AOh14GgYI6sPaAhHFyKhMLU-tFfkNZcaViH5m0hGqmkY=s128-c0x00000000-cc-rp-mo","rating":5,"relative_time_description":"a week ago","text":"Katie really did make our evening. We were lucky to get a table but we had a great time. The spirit at The Sun is a place you should all experience. Thanks team!","time":1619886225},{"author_name":"Laurence Hurley","author_url":"https://www.google.com/maps/contrib/106485179305688068821/reviews","language":"en","profile_photo_url":"https://lh3.googleusercontent.com/a/AATXAJxM-YTS5Ze53MO6Dhqb-3HbFlAS8xrH7vG7lCsB=s128-c0x00000000-cc-rp-mo-ba3","rating":5,"relative_time_description":"a week ago","text":"Great staff, fantastic food and decent drinks selection. Well adapted to post lockdown restrictions and very accommodating. Will be returning.","time":1619900497}],"types":["bar","restaurant","food","point_of_interest","establishment"],"url":"https://maps.google.com/?cid=2199479277105159945","user_ratings_total":653,"utc_offset":60,"vicinity":"47 Old Town, London","website":"https://www.thesunclapham.co.uk/?utm_source=google&utm_medium=organic&utm_campaign=gmb"},"status":"OK"}

