 before corona came along, and they still do not disappoint! I called up as I am pregnant and wanted to ask about the eggs. The lady I spoke to this morning  was cherry even though it was 9am and more then happy to help. Sorry I can't remember your name. She assured me they would cook the eggs well for me, they done  just that! Thanks guys. As always the food was AMAZING! Go and order. Thanks for note on my bag made me SMILE","time":1617179716},{"author_name":"Angelica Thomas","author_url":"https://www.google.com/maps/contrib/115971016175373722370/reviews","language":"en","profile_photo_url":"https://lh3.googleusercontent.com/a-/AOh14Gj3jj2mZlYiphJ-_iq0J_-_LzY10MERq2_Zs_iahw=s128-c0x00000000-cc-rp-mo-ba3","rating":4,"relative_time_description":"3 weeks ago","text":"The vibe was great and the food delicious, despite the fact that full service is limited due to restrictions.

