derflower cocktail.. yuk! I ended up mixing it in the rum punch which made a huge difference. Nice place but cocktails ain't really worth the money unless you have the options of creating your own.","time":1599076141},{"author_name":"Natasha Rollins","author_url":"https://www.google.com/maps/contrib/102450518652341329340/reviews","language":"en","profile_photo_url":"https://lh3.googleusercontent.com/a/AATXAJy-1klW3ERgezaqHNpUJCRPSMkMGWwp2mo6wLKB=s128-c0x00000000-cc-rp-mo-ba3","rating":5,"relative_time_description":"7 months ago","text":"The first experience coming here a party of 6 I had booked for the birthday package, I have to say I had a great birthday spent here on the 25th, I can't fault them for anything from the bouncer at the door (black guy) who was very nice and polite. To the young women who took me to my table and who served us. I wish I knew her name she was amazing lovely polite, friendly, helpful excellent customer service. The cocktails as you can see tasted as good as they looked, it was just a shame it had to be cut short. No-fault of there own just following guidelines because apparently corona only comes out after 10 pm it works on zero contract hours. Anyhow well recommended get there early as they will advice last orders are 8.45 pm.","time":1601199525}],"types":["bar","point_of_interest","establishment"],"url":"https://maps.google.com/?cid=12870557401396132106","user_ratings_total":75,"utc_offset":60,"vicinity":"182-184 Clapham High Street, London","website":"https://londoncocktailclub.co.uk/"},"status":"OK"}

